import React from "react";
import { useParams } from "react-router-dom";

const CoinDetails = ({ coins }) => {
  const { uuid } = useParams();

  return (
    <>
      {coins
        .filter((coin) => coin.uuid === Number(uuid)) // seems useParams returned id as string instead of number.
        .map((coin, index) => (
          <div key={index}>
            <h1>{coin.name}</h1>
            <h1>{coin.symbol}</h1>
            <img
              alt={crypto}
              src={coin.iconUrl}
              className="w-16 h-16 rounded-full"
            />
          </div>
        ))}
    </>
  );
};

export default CoinDetails;
